import React from "react";

const Footer = () => {
  return (
    <footer className="section">
      <div className="footer">
        <div className="footer__logo"></div>
        <div className="footer__links">
          <div className="footer__links--1">Shop</div>
          <div className="footer__links--2">About</div>
          <div className="footer__links--3">Contact</div>
          <div className="footer__links--4">Home</div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
